  \"Development of Energy Efficient, Multi-Channel, Pulsed Plasma Generator for High-Speed
  Flow Control by Localized Arc Filament Plasma Actuators Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T14:29:18.072768\",\n\t\"name\": \"development-of-energy-efficient-multi-channel-pulsed-plasma-generator-for-high-speed-flow-\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The research team at The Ohio State University
  has been developing technologies to suppress jet noise using localized arc filament
  plasma actuators and are in the process of demonstrating this type of technology
  at NATR facility at NASA Glenn Research Center.  The localized arc filament plasma
  actuators developed at OSU are the only actuators that can be used currently for
  active control of flow and noise in high Reynolds number and high-speed flows, such
  as jets, mixing layers, combustors, cavity, etc. However, the lack of availability
  of appropriate plasma generator has been a hindrance to this technology development.
  \ One of the challenges is designing and developing a power supply which can derive
  up to 64 actuators. The current Phase I SBIR program will explore some new technologies
  for the design of such a power supply.  The research team will focus on building
  the power supply for NASA during the Phase II program and also will make significant
  efforts in commercializing this product by making it much more energy sufficient,
  user friendly, and compact.  \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
